Nuage = function() {
    let res=new createjs.Container()

    let nuage=new createjs.Container();
    let shape = new  createjs.Shape();
    let shape_1 = new  createjs.Shape();  
    shape.graphics.f("#CCCCCC").s().p("");
    shape.setTransform(0,1.1);  
    shape_1.graphics.f("#FFFFFF").s().p("");
    nuage.addChild( shape_1, shape);

    res.evapore=function(n,M){
        if(n>M){res.alpha=0} else {
            let r=-90+180*Math.random();
            let X=-10+20*Math.random();
            let Y=-10+20*Math.random();
            let scale=1+0.5*Math.random();
            createjs.Tween.get(nuage).wait(200*Math.random()).to({x:X,y:Y,rotation:r,scaleX:scale,scaleY:scale,alpha:0.1},500).call(()=>{
                nuage.rotation=nuage.x=nuage.y=0;
                nuage.scaleX=nuage.scaleY=1
                nuage.alpha=1
                res.evapore(n+1,M);
            })
        }
    }

    res.addChild( nuage);

    //res.evapore();
   return(res)
}


