la_scene = function() {
    let res=new createjs.Container()

   // Layer 1
    res.perso = new  indy();
    res.perso.setTransform(305.3,75.4,1,1,0,0,0,0,-211.1);
    res.perso.ox=res.perso.x;
    res.perso.oy=res.perso.y;
    res.perso.x=1000;

    res.conteneur_pyramide=new createjs.Container();
    res.conteneur2_pyramide=new createjs.Container();    
    res.pyra = new  createjs.Bitmap(images["pyramide"]);
    res.conteneur_pyramide.addChild(res.conteneur2_pyramide)
    res.conteneur2_pyramide.addChild(res.pyra)
    res.pyra.setTransform(-444.1,11,0.31,0.31,-5.9);

    let fond= new  createjs.Bitmap(images["background"]);
    fond.setTransform(-413.3,-286.4,0.67,0.67);

    res.addChild( fond,res.conteneur_pyramide,res.perso);
    return(res)
}


